import './header.css';
import { FontAwesomeIcon } from "@fortawesome/react-fontawesome";



function Header() {
    return(
<div className="header">       
    
    <div className="logos">
        <h1 className="h1Logo">MKS</h1>
        <h3 className="h3Logo">Sistemas</h3>  
        <i class="fa-regular fa-cart-shopping-fast"></i>
    </div>
   
    <div className="btn-div">
        <input  className="btn-carrinho"  type="button" value="0" />
    </div>

</div> 


    )
}

export default Header;
